import React from 'react';
import cardOne from './img/cardOne.webp';
import cardTwo from './img/cardTwo.webp';
import cardThree from './img/cardThree.webp';
import cardFour from './img/cardFour.webp';
import cardFive from './img/cardFive.webp';
import cardSix from './img/cardSix.webp';
import cardSeven from './img/cardSeven.webp';
import cardEight from './img/cardEight.webp';

import Cards from './cards';


function ListCard(props) {
  const {search} = props
  const cards = [
    {
      id: 1,
      img: cardOne,
      name: 'Сырная',
      desc: 'Моцарелла, смесь сыров чеддер и пармезан, соус альфредо...',
      price: 'от 295 som',
      
    },
    {
      id: 2,
      img: cardTwo,
      name: 'Двойной цыпленок',
      desc: 'Двойная порция...',
      price: 'от 325 som'
    },
    {
      id: 3,
      img: cardThree,
      name: 'Кебаб пицца',
      desc: 'Донерное мясо из говядины, моцарелла, томаты, красный лук,...',
      price: 'от 475 som'
    },
    {
      id: 4,
      img: cardFour,
      name: 'Супермясная',
      desc: 'Цыпленок, пепперони из цыпленка, ветчина из цыпленка, фарш из говядины,...',
      price: 'от 445 som'
    },
    {
      id: 5,
      img: cardFive,
      name: 'Пепперони',
      desc: 'Пепперони из цыпленка, увеличенная порция моцареллы, томатный соус...',
      price: 'от 445 som'
    },
    {
      id: 6,
      img: cardSix,
      name: 'Пицца из половинок',
      desc: 'Собери свою пиццу 35см двумя разными вкусами...',
      price: 'от 445 som'
    },
    {
      id: 7,
      img: cardSeven,
      name: 'Бургер-пицца',
      desc: 'Ветчина из цыпленка, моцарелла, лук красный, томаты...',
      price: 'от 445 som'
    },
    {
      id: 8,
      img: cardEight,
      name: 'Овощи и грибы',
      desc: 'Моцарелла, кубики брынзы, томаты, маслины, шампиньоны, сладкий перец...',
      price: 'от 445 som'
    },
  ];

  return (
    <div>
        <Cards cards={cards}  search={search}/>
    </div>
  )
}

export default ListCard;
